INSERT INTO `dewasa_ayu` VALUES (1,'Agni Agung Doyan Basmi','Bersifat panas, tidak baik membangun rumah, terutama tidak baik mengatapi rumah, karena mudah terbakar. Baik untuk mulai membakar bata, genteng, gerabah, keramik, tembikar, dan lain-lain.'),(2,'Agni Agung Patra Limutan','Baik membuat/meramu obat-obatan, menghilangkan yang angker. Tidak baik membangun rumah, mengatapi rumah, pindah rumah, atau memasuki rumah baru.'),(3,'Amerta Akasa','Baik untuk memuja leluhur/Pitra Yadnya dan Dewa Yadnya'),(4,'Amerta Bumi','Baik untuk perkawinan (nikah).'),(5,'Amerta Buwana','Baik untuk upacara Dewa Yadnya dan Pitra Yadnya'),(6,'Amerta Dadi','Baik untuk upacara Dewa Yadnya dan pemujaan terhadap leluhur.'),(7,'Amerta Danta','Baik untuk melakukan tapa, brata, yoga, semadi, penyucian diri, segala pekerjaan.'),(8,'Amerta Dewa','Baik untuk melakukan Panca Yadnya khususnya Dewa Yadnya, membangun tempat-tempat suci/ibadah, membuat lumbung maupun dapur.'),(9,'Amerta Dewa Jaya','Baik untuk hal-hal yang mengandung unsur keunggulan.'),(10,'Amerta Dewata','Baik untuk semua upacara.'),(11,'Amerta Gati','Baik untuk memaulai suatu usaha, bercocok tanam.'),(12,'Amerta Kundalini','Baik untuk bercocok tanam, segala kegiatan atau yadnya.'),(13,'Amerta Masa','Baik untuk upacara Dewa Yadnya, membangun, dan bercocok tanam.'),(14,'Amerta Murti','Baik untuk melakukan upacara Manusa Yadnya, upacara potong gigi'),(15,'Amerta Pageh','Baik untuk upacara Dewa Yadnya.'),(16,'Amerta Papageran','Tidak baik untuk melakukan dewasa ayu karena mengandung pengaruh sakit-sakitan.'),(17,'Amerta Sari','Baik untuk upacara Dewa Yadnya di sanggah/merajan, menanam bunga-bungaan.'),(18,'Amerta Wija','Baik untuk upacara Dewa Yadnya, menanam biji-bijian.'),(19,'Amertayoga','Baik untuk membangun, mencari pengupa jiwa (nafkah), dan memulai suatu usaha/perusahaan.'),(20,'Asuajeg Munggah','Baik untuk membuat alat-alat yang menakutkan seperti lelakut. Tidak baik untuk menanam padi, kacang-kacangan.'),(21,'Asuajeg Turun','Baik untuk membuat penakut, menanam padi, kacang-kacangan, sirih. berburu, membuat alat bunyi-bunyian, kentongan, gamelan, genta, dll.'),(22,'Asuasa','Mengandung sifat boros, tidak baik untuk berbelanja, tidak baik untuk dewasa ayu.'),(23,'Ayu Badra','Baik untuk memulai suatu usaha, bercocok tanam, membangun.'),(24,'Ayu Dana','Hari Baik melaksanakan Panca Yadnya, segala macam pekerjaan, berdana punia, bersuci laksana, mengajukan permohonan, bercocok tanam.'),(25,'Ayu Nulus','Baik untuk segala usaha.'),(26,'Babi Munggah','Tidak baik untuk bercocok tanam.'),(27,'Babi Turun','Baik untuk memasang sesirep.'),(28,'Banyu Milir','Baik untuk membuat sumur, kolam, membuka jalan air, ngirisin (menyadap nira).'),(29,'Banyu Urug','Baik untuk membuat bendungan. Tidak baik untuk membuat sumur.'),(30,'Bojog Munggah','Tidak baik untuk menanam padi, jagung.'),(31,'Bojog Turun','Baik untuk menyetem gambelan.'),(32,'Buda Gajah','Baik untuk melakukan tapa, brata, yoga, semadi, upacara penyucian (pebersihan lahir batin), dan upacara Dewa Yadnya.'),(33,'Buda Ireng','Baik untuk segala pekerjaan.'),(34,'Buda Suka','Baik untuk segala pekerjaan.'),(35,'Carik Walangati','Tidak baik untuk melakukan pernikahan/wiwaha, atiwa-tiwa/ngaben dan membangun rumah.'),(36,'Catur Laba','Baik untuk bepergian menuju arah utara, upacara Manusa Yadnya, dan Pitra Yadnya.'),(37,'Cintamanik','Baik untuk melakukan upacara potong rambut.'),(38,'Corok Kodong','Baik untuk membuat jaring.'),(39,'Dadig Krana','Baik untuk menanam tebu, mentimun. Tidak baik untuk upacara atau yadnya, mengadakan pertemuan (rapat), berenggama.'),(40,'Dasa Amerta','Baik untuk melakukan upacara pembersihan diri, upacara potong gigi, pernikahan tanpa memperhitungkan sasih.'),(41,'Dasa Guna','Baik untuk membuat bangunan suci, pelantikan pengurus/pejabat.'),(42,'Dauh Ayu','Baik untuk membuat awig-awig, peraturan-peraturan atau undang-undang, baik untuk membangun.'),(43,'Derman Bagia','Baik untuk nikah, membangun, mulai belajar/berlatih, belajar menari.'),(44,'Dewa Ngelayang','Baik untuk membuat bangunan suci, Dewa Yadnya dan Pitra Yadnya.'),(45,'Dewa Stata','Baik untuk melakukan Panca Yadnya, khususnya Dewa Yadnya.'),(46,'Dewa Werdi','Baik untuk upacara Dewa Yadnya, upacara potong gigi.'),(47,'Dewasa Mentas','Baik untuk melakukan segala macam yadnya, upacara penyucian (pembersihan), memberi petuah-petuah (nasehat), memberi petunjuk jalan yang berguna, serta baik untuk membangun.'),(48,'Dewasa Ngelayang','Baik untuk membangun rumah, membuat jukung dan sejenisnya.'),(49,'Dewasa Tanian','Baik untuk mulai menanam, mulai suatu usaha pertanian.'),(50,'Dina Carik','Tidak baik dipakai dewasa.'),(51,'Dina Jaya','Baik untuk belajar menari atau pengetahuan yang lain dan mengandung unsur keunggulan.'),(52,'Dina Mandi','Baik untuk upacara penyucian diri, memberikan petuah-petuah, membuat jimat.'),(53,'Dirgahayu','Baik untuk mulai belajar.'),(54,'Dirgayusa','Baik untuk upacara Manusa Yadnya seperti potong gigi dan lain-lain.'),(55,'Gagak Anungsang Pati','Tidak baik melakukan upacara membakar mayat, atiwa-tiwa'),(56,'Geheng Manyinget','Tidak baik untuk segala pekerjaan yang penting-penting termasuk melakukan yadnya karena banyak ganguan.'),(57,'Geni Agung','Tidak baik dipakai dewasa, sangat buruk.'),(58,'Geni Murub\r\n','Baik untuk segala pekerjaan yang mempergunakan api seperti membakar bata mentah, genteng, dan lain-lain. Tidak baik untuk membangun, mengatapi rumah.'),(59,'Geni Rawana','Baik untuk segala pekerjaan yang menggunakan api. Tidak baik untuk mengatapi rumah, melaspas, bercocok tanam.'),(60,'Gni Rawana Jejepan','Baik untuk mulai pekerjaan yang menggunakan api seperti membakar genteng, batu bata, keramik, gerabah, membuat senjata tajam (pande besi). Tidak baik mengatapi rumah, melaspas, dan bercocok tanam.'),(61,'Gni Rawana Rangkep','Baik untuk segala pekerjaan yang mempergunakan api. Tidak baik untuk membangun, mengatapi rumah.'),(62,'Guntur Umah/Graha','Baik untuk membangun atau memindahkan rumah.'),(63,'Ingkel Macan','Baik untuk menangkap banteng/sapi, kerbau, kuda, kambing, dan sejenisnya, dan untuk berburu'),(64,'Istri Payasan','Mengandung unsur keindahan. Baik untuk melaspas dan bercocok tanam'),(65,'Jiwa Menganti','Baik untuk bercocok tanam dan memulai suatu usaha.'),(66,'Kajeng Kipkipan','Baik untuk membuat dungki (keranjang kecil tempat ikan).'),(67,'Kajeng Kliwon Enyitan','Baik untuk memulai membuat sesikepan atau sesuatu yang berkekuatan gaib'),(68,'Kajeng Lulunan','Tidak baik untuk membuat sok dan sejenisnya.'),(69,'Kajeng Rendetan','Baik untuk menanam tumbuhan yang menghasilkan buah.'),(70,'Kajeng Susunan','Baik untuk membuat sok atau sejenisnya.'),(71,'Kajeng Uwudan','Tidak baik untuk menanam dan memetik tanaman.'),(72,'Kala Alap','Baik untuk menanam kelapa.'),(73,'Kala Angin','Baik untuk memulai mengajar/melatih sapi, kerbau, kuda, dan ternak lainnya.'),(74,'Kala Atat','Baik untuk membuat tali, tali pancing, melakukan pekerjaan anyam-anyaman, tampus, jerat.'),(75,'Kala Awus','Baik untuk membuat garu (lampit). Tidak baik untuk membuat bendungan/empangan, membangun rumah.'),(76,'Kala Bancaran','Baik untuk membuat senjata, taji, pengiris (pisau besar untuk mengiris atau untuk mengadap nira).'),(77,'Kala Bangkung, Kala Nanggung','Tidak baik untuk mulai memelihara ternak.'),(78,'Kala Beser','Baik untuk menyadap tirta, mengasah taji, tombak. Tidak baik untuk membuat empangan/bendungan, berbicara yang sifatnya rahasia.'),(79,'Kala Brahma','Mengandung arti kepanasan atau kesakitan.'),(80,'Kala Bregala','Tidak baik dipakai dewasa ayu.'),(81,'Kala Buingrau','	Baik untuk menebang kayu, membuat bubu, memuja pitra. Tidak baik untuk membangun, mengatapi rumah.'),(82,'Kala Cakra','Baik untuk memulai segala jenis pekerjaan, mengandung arti kebulatan tekad.'),(83,'Kala Capika','Baik untuk membuat pancing (kail), perangkap.'),(84,'Kala Caplokan','Baik untuk membuat alat-alat penangkap ikan seperti pancing (kail), jala, jaring, bubu, bahan untuk umpan.'),(85,'Kala Cepitan','Baik untuk membuat pancing, jebag/perangkap, dan alat yang berfungsi menjepit.'),(86,'Kala Dangastra','Baik untuk membangun tembok pekarangan, membuat alat-alat penangkap ikan. Tidak baik untuk memulai pekerjaan penting, tidak baik melakukan upacara (gawe ayu).'),(87,'Kala Dangu','Tidak baik untuk memulai suatu pekerjaan, pindah tempat, bepergian.'),(88,'Kala Demit','Baik untuk memasang tanda-tanda atau alat-alat yang mengandung arti larangan, membuat pagar, memasang pelindung kelapa (ngangasin), hal-hal menghalau, atau mengusir. Tidak baik unruk mengajukan permohonan.'),(89,'Kala Empas Munggah','Baik untuk membangun rumah. Tidak baik untuk memetik buah-buahan.'),(90,'Kala Empas Turun','Baik untuk menanam umbi-umbian. Tidak baik untuk membangun, memetik buah-buahan.'),(91,'Kala Gacokan','Baik untuk membuat alat-alat yang runcing seperti taji, tombak dan sebagainya.'),(92,'Kala Garuda\r\n','Tidak baik untuk dipakai dewasa ayu.'),(93,'Kala Geger','Baik untuk membuat alat-alat penangkap ikan, membuat kentongan, cagcag (perkakas tenun), kroncongan (genta sampi dari kayu), genta (bajra), kendang (bedug), gambelan, dan alat bunyi-bunyian lainnya.'),(94,'Kala Gotongan','Baik untuk memulai suatu usaha. Tidak baik untuk mengubur atau membakar mayat.'),(95,'Kala Graha','Baik untuk membangun perumahan.'),(96,'Kala Gumarang Munggah','Baik melakukan upacara Bhuta Yadnya. Tidak Baik untuk menanam sirih, tembakau.'),(97,'Kala Gumarang Turun','Baik untuk menanam sirih dan tambakau. Tidak baik untuk pembuatan bibit.'),(98,'Kala Guru','Baik untuk membuat peraturan, awig-awig.'),(99,'Kala Ingsor','Mengandung sifat/tanda-tanda mengecewakan'),(100,'Kala Isinan','Baik untuk mulai belajar, membuat almari, membuat gudang atau tempat barang-barang.'),(101,'Kala Jangkut','Baik untuk membuat pencar, jaring, senjata.'),(102,'Kala Jengkang','Baik untuk membuat alat penangkap ikan, bubu dan mengadakan sabungan ayam (tajen)'),(103,'Kala Jengking','Baik untuk mulai belajar menari, menabuh, membuat bubu, seser, jaring. Tidak baik untuk Manusa Yadnya, nikah, upacara potong rambut.'),(104,'Kala Katemu','Baik untuk menangkap ikan, berburu, mapikat, memasang jerat, kungkungan, mangadakan pertemuan.'),(105,'Kala Keciran','Baik untuk membuat pisau penyadap (pengiris), mulai memotong danggul nira, membuat atau membuka saluran air.'),(106,'Kala Kilang-kilung','Baik untuk membuat barong, membuat sok (bakul), dan segala anyam-anyaman.'),(107,'Kala Kingkingan','Tidak baik untuk meminang.'),(108,'Kala Klingkung','Baik untuk mencuri demi kepentingan umum yang bertujuan baik.'),(109,'Kala Kutila Manik','Baik untuk membuat ranjau, pagar, rintangan, lubang penghalang maupun pemisah, alat perangkap, upacara Bhuta Yadnya.'),(110,'Kala KutilaÂ ','Baik untuk memulai pekerjaan yang mempergunakan api.'),(111,'Kala Luang','Baik untuk membuat terowongan, menanam ketela atau umbi-umbian.'),(112,'Kala Lutung Magelut','	Baik untuk membuat/meramu obat-obatan, mencampur sadek (makanan jangkrik), mulai membikin sawuh, melakukan tapa brata. Tidak baik untuk berburu.'),(113,'Kala Lutung Megandong','Baik untuk menanam pijer (bibit kelapa yang baru tumbuh), menanam buah-buahan.'),(114,'Kala Macan','	Baik untuk membuat segala yang menakutkan, membuat tombak, keris, lelakut (penakut). Tidak baik untuk berbicara yang tidak perlu'),(115,'Kala Mangap','Tidak baik untuk berbelanja, bila menggunakan hari ini akan berakibat boros.'),(116,'Kala Manguneb','Baik untuk membuat paketok (perangkap landak) dan santeb (semacam perangkap binatang).'),(117,'Kala Matampak','Baik untuk menanam segala sesuatu (bercocok tanam).'),(118,'Kala Mereng','Tidak baik untuk bercocok tanam'),(119,'Kala Miled','Baik untuk meramu obat-obatan, sadek dan yang sejenisnya.'),(120,'Kala Mina','Baik untuk membuat peralatan penangkap ikan, tombak, dan baik untuk menangkap ikan.'),(121,'Kala Mretyu','Baik untuk membuat senjata, mulai berperang membela kebenaran, memberi nasehat kepada orang lain. Tidak baik untuk bersenggama, segala yadnya.'),(122,'Kala Muas','Tidak baik untuk menanam sesuatu (bercocok tanam).'),(123,'Kala Muncar','Baik untuk membuat taji, mengasah senjata.'),(124,'Kala Muncrat','Baik untuk membuat keris, tombak, taji dll.'),(125,'Kala Ngadeg','Baik untuk membuat pintu gerbang, tembok pekarangan, pagar, sangkar ayam (guwungan), kisa pengaduan, mulai memeliharan ayam kurungan, membuat empangan/bendungan.	Redite Pujut. Redite Krulut. Soma Tambir. Soma Kulawu. Sukra Kuningan. Sukra Watugunung.'),(126,'Kala Ngamut','Baik untuk membuat pancing (kail) dan alat-alat panangkap ikan lainnya.'),(127,'Kala Ngruda','Baik untuk membuat taji, keris, ranjau (sungga), bambu runcing (gelanggang) dan sejenisnya, membuat rencana baik. Tidak baik untuk segala pekerjaan, akan mendapat godaan/halangan sakit keras, melakukan yadnya yang besar.'),(128,'Kala Ngunya','Baik untuk berkunjung, membuat/memasang kungkungan dan bubu.'),(129,'Kala Olih','Baik untuk memulai suatu usaha. Tidak baik untuk membuat terowongan, sumur, mulai membajak.'),(130,'Kala Pacekan','Baik untuk membuat tombak, taji, keris, dan sejenisnya. Tidak baik untuk mengadakan perundingan/rapat.'),(131,'Kala Pager','Baik untuk membuat tembok, pagar, dan sejenisnya. Tidak baik untuk bepergian.'),(132,'Kala Panyeneng','Baik untuk membuat peraturan-peraturan, awig-awig, membuat tempat penyimpanan harta benda.'),(133,'Kala Pati','Baik untuk membuat jerat dan memasangnya, pembuat pengrusak. Tidak baik untuk semua upacara dan pekerjaan yang lainnya.'),(134,'Kala Pati Jengkang','Baik untuk mengadakan sabungan.'),(135,'Kala Pegat','Baik untuk mulai menyadap (ngirisin), memisah bayi menetek (melas rare). Tidak baik untuk melakukan karya ayu.'),(136,'Kala Prawani','Tidak baik untuk semua kegiatan, hari ini mengandung pengaruh yang kurang baik.'),(137,'Kala Raja','Baik untuk segala pekerjaan, mengkat atau melantik petugas atau calon pejabat.'),(138,'Kala Rau','Baik untuk meramu obat-obatan, sadek, membuat senjata, upas (penjaga). Tidak baik untuk membangun rumah, mengatapi rumah akibatnya akan terbakar, batasi berbicara yang dapat menimbulkan kekeliruan, mengawinkan orang.'),(139,'Kala Rebutan','Baik untuk membuat tempat berjualan, membuat alat-alat tempat barang dagangan, alat-alat penangkap ikan, membuat dan memasang kungkungan.'),(140,'Kala Rumpuh','Tidak baik untuk pindah rumah, memulai memelihara ayam, itik, sapi, kerbau, kambing, babi (ternak).'),(141,'Kala Sapuhau','Baik untuk membuat alat-alat pertanian seperti garu, tulud, pemlasahan, tenggala (bajak). Tidak baik untuk membangun.'),(142,'Kala Sarang','Mengandung sifat boros/terapas. Tidak baik untuk berbelanja'),(143,'Kala Siyung','Tidak baik, hari ini harus diwaspadai karena mengandung pengaruh buas.'),(144,'Kala Sor','Tidak baik untuk bekerja hubungannya dengan dengan tanah seperti membajak, bercocok tanam, membuat terowongan.'),(145,'Kala Sudangastra','Baik untuk membuat alat-alat yang runcing.'),(146,'Kala Sudukan','Tidak baik untuk memindahkan orang sakit, menunjukkan unsur perombakan.'),(147,'Kala Sungsang','Mengandung sifat/unsur terbalik, bertentangan, kontras. Tidak baik untuk melakukan karya ayu atau yadnya'),(148,'Kala Susulan','Baik untuk membuat tepis, sabang, jating.'),(149,'Kala Suwung','Tidak baik untuk dewasa ayu, berkunjung.'),(150,'Kala Tampak','Tidak baik untuk dewasa nikah (perkawinan).'),(151,'Kala Temah','Tidak baik untuk dewasa ayu.'),(152,'Kala Timpang','Baik untuk membuat senjata, membuat/memasang ranjau, guna-guna, meramu sadek, memasang sesuatu yang merupakan larangan pada tanaman. Tidak baik untuk berburu.'),(153,'Kala Tukaran','Baik untuk memasang jaring/tepis, mapikat (mencari burung), mulai melatih atau mengajar burung.'),(154,'Kala Tumapel','Baik untuk membuat topeng (tapel), membuat dan memasang kungkungan (tempat mengurung lebah.'),(155,'Kala Tumpar','Tidak baik untuk dewasa ayu karena mengandung unsur kecewa.'),(156,'Kala Upa','Baik untuk memulai mengambil/memelihara ternak (wewalungan).'),(157,'Kala Was','Baik untuk mengebiri (melesin) hewan, menebang kayu untuk bahan bangunan.'),(158,'Kala Wikalpa','Baik untuk membuat keris dan yang sejenisnya.'),(159,'Kala Wisesa','Baik untuk menebang kayu bahan bangunan, memulau suatu kegiatan, mengangkat/melantik petugas.'),(160,'Kala Wong','Tidak baik untuk magundul (digundul), meotong rambut atau macukur (dicukur), meminang, melakukan upacara manusa yadnya.'),(161,'Kaleburau','Tidak baik melakukan karya ayu atau yadnya. Tidak baik melaksanakan atiwa-tiwa/ngaben'),(162,'Kamajaya','Baik untuk dewasa pernikahan, membangun, membuat alat-alat perang, mulai belajar/berlatih.'),(163,'Karna Sula','Tidak baik untuk melangsungkan perkawinan, mengambil/menangkap/membeli binatang peliharaan, mengadakan pertemuan/rapat, berbicara kepada orang lain.'),(164,'Karnasula','Baik untuk membuat kentongan, bajra, kendang, kroncongan (denta sapi dari kayu) dan sejenisnya. Tidak baik untuk membangun rumah tempat tidur, mengadakan rapat atau pertemuan.'),(165,'Lebur Awu','Tidak baik melakukan upacara wiwaha/pernikahan, pertemuan, membangun rumah, mengatapi rumah. Baik untuk membangun irigasi.'),(166,'Lutung Megandong','Baik untuk menanam buah-buahan dan umbi-umbian'),(167,'Macekan Agung','Untuk membuat benda-benda runcing untuk pura seperti pengawin, tumbak, senjata pengider-ider dll.'),(168,'Macekan Lanang','Baik untuk membuat taji, tumbak, keris, alat penangkap ikan. Tidak baik untuk upacara yadnya'),(169,'Macekan Wadon','Baik untuk membuat taji, tumbak, keris, alat penangkap ikan'),(170,'Mreta Sula','Tidak baik untuk melakukan semua macam yadnya'),(171,'Naga Naut','Tidak baik untuk dewasa ayu'),(172,'Pamacekan','Baik untuk mengerjakan sawah/tegal, membuat tombak penangkap ikan. Tidak baik melaksanakan yadnya'),(173,'Panca Amerta','Baik untuk pernikahan, melaukan upacara pembersihan diri.'),(174,'Panca Prawani','Tidak baik dipakai dewasa ayu.'),(175,'Panca Werdi','Baik untuk upacara potong gigi, potong rambut.'),(176,'Pati Paten','Tidak baik untuk melakukan 