ah/nasehat.'),(216,'Uncal Balung','Tidak baik melakukan semua jenis perkerjaan yang dianggap penting.'),(217,'Upadana Amerta','Baik untuk menanam suatu tanaman, membuat alat-alat berdagang atau mulai berjualan.'),(218,'Werdi Suka','Baik untuk upacara Dewa Yadnya.'),(219,'Wisesa','Baik untuk upacara mabersih/dwijati, mapeningan, mabiseka ratu'),(220,'Wredhi Guna','Baik untuk melakukan segala upacara (panca yadnya) karena akan memperoleh manfaat yang berlimpah');
